import './Home.css'
import marela from '../Assets/marela.jpeg';
import title from '../Assets/name.svg'

export default function Home(){
    return(
        <>
            <div className="root">
                <div className="title">
                    <img src={title}/>
                </div>
                <div className="image">
                    <img src={marela}/>
                </div>
            </div>
        </>
    );
}
